const MainPage = () => {

      return (
        <div className="container">
          <div className="sidebar">
          <SideBar/>
          </div>
          <div className="main-content">
          <h1>About the project</h1>
          <p>This project has been created with the inspiration of the work of SquirrelPlays.</p>
          <p>The two views used in the game are created by him.</p>
          <p>I rework his table of characteristics and the way of calculating score.</p>
          <p>Rest of the project is mine.</p>
          <p>Major improvement, I created a first version of generation of the best 11, with a formation and chosen roles.</p>
          <h1>How to use ?</h1>
          </div>
        </div>
      )
    }

export default MainPage;
